$.fn.botany=function(){if(!this.hasClass("botany")||"UL"!=this.prop("tagName"))throw new Error("The target of $().botany must be a <ul> element with the class .botany");$(this).on("click","li, ul, .botany-open, .botany-closed",function(e){var n=$(e.target).closest("li"),o=$(n).children("ul");n.hasClass("open")?o.children().length>0?o.slideUp(function(){n.removeClass("open")}):n.removeClass("open"):o.children().length>0?(o.hide(),n.addClass("open"),o.slideDown()):n.addClass("open"),e.stopPropagation()})};